import React from "react";

const Teste = () => {
  const array1 = [
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];
  const array2 = [
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];

  const filterArray = (array1, array2) => {
    const filtered = array1.filter((ar1) => {
      console.log(ar1);
      return array2.indexOf(ar1) === -1;
    });
    return filtered;
  };
  console.log(filterArray(array1, array2));

  return (
    <div style={{ marginLeft: "1000px", marginTop: "300px" }}>
      {array1.map((a) => (
        <h1>{a.desc}</h1>
      ))}
    </div>
  );
};

export default Teste;
